import React,{Component} from "react";
import axios from "axios";
import {Link} from 'react-router-dom';
//import Package from "../../../TourPackage/BACKEND/models/Package";



export default class AllPacks extends Component{


   constructor(props){

       super(props);

       this.state={

        packages:[]
       };

   }
  componentDidMount(){

   this.retrivePackages();
  }
  retrivePackages(){

   axios.get("http://localhost:8070/package/all").then(res=>{

      if(res.data.success){
          this.setState({

            packages:res.data.existingPackages

          });

          console.log(this.state.packages)

      }


   })



  }



  
     
  onDelete(id){

     fetch(`http://localhost:8070/package/delete/${id}`,{

           method:`DELETE`




     }).then((result)=>{

         result.json().then((resp)=>{

           console.warn(resp)
           alert("Deleted Succsessfull")
           this.retrivePackages()

         })


     })
    


  }



 render(){

    return(

      <div className="container" class="p-3 mb-2 bg-secondary text-white">

      <h1><center><strong>All Packages</strong></center></h1>
      <table class="table table-dark table-hover">
      <thead>
      <tr class="text-danger">
           <th scope="col">Count</th>
           <th scope="col">PackageName</th>
           <th scope="col">PackageID</th>
           <th scope="col">Destination</th>
           <th scope="col">NumberofDays</th>
           <th scope="col">NumberofPassengers</th>
           <th scope="col">Hotel</th>
           <th scope="col">Transport</th>
           <th scope="col">TourGuide</th>
           <th scope="col">TotalPrice(Rs)</th>
           <th scope="col">Action</th>
  
  
      </tr>
     </thead>
     <tbody>

       {this.state.packages.map((packages,index)=>(

        <tr>
          <th scope="row">{index+1}</th>
          <td>{packages.name}</td>
          <td>{packages.packId}</td>
          <td>{packages.destination}</td>
          <td>{packages.numofdays}</td>
          <td>{packages.nopass}</td>
          <td>{packages.hotel}</td>
          <td>{packages.transport}</td>
          <td>{packages.tourGuide}</td>
          <td>{packages.totPrice}</td>

          <td>
          <Link to = {`/update/${packages._id}`} className="button-update">Update</Link>
                               

               <button  type="button" class="btn btn-success"  onClick={()=>this.onDelete(packages._id)}> <i className="fa-solid fa-trash-can "></i>&nbsp;&nbsp; Delete Package&nbsp;&nbsp;&nbsp;</button>
        </td>
        </tr>

       ))}



     </tbody>



     </table>
     <a href="man" class="btn btn-info" style={{width:"300px"}}><strong><i className="fa-solid fa-user-clock"></i>&nbsp;&nbsp;Admin's page</strong></a>
     <br></br>&nbsp;
     <td></td>
     <a href="/report" class="btn btn-info" style={{width:"300px"}}><strong><i className="fa-solid fa-user-clock"></i>&nbsp;&nbsp;Report</strong></a>

  
      </div>

    

    ) 
 }

 }
